import React from 'react';

function Position(prop) {
  return (
    <table>
      <tbody>
        <tr>
          <td class_name='position_column'>
            <a href={prop.link}> {prop.title} </a>
          </td>

          <td class_name='company_column'>
            {prop.company}
          </td>

          <td class_name='website_column'>
            {prop.website}
          </td>
        </tr>
      </tbody>
    </table>
  )
}

export default Position
